import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Home from './pages/Home';
import SignIn from './pages/SignIn';
import SignUp from './pages/SignUp';
import RoommateSearch from './pages/RoommateSearch';
import BuildingSearch from './pages/BuildingSearch';
import UserProfile from './pages/UserProfile';
import ProfileView from './pages/ProfileView';
import BuildingDetails from './pages/BuildingDetails';
import { AuthProvider } from './context/AuthContext';

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="min-h-screen bg-gray-50">
          <Routes>
            <Route 
              path="/" 
              element={<Navigate to="/home" replace />} 
            />
            <Route 
              path="/home" 
              element={<Home />} 
            />
            <Route path="/signin" element={<SignIn />} />
            <Route path="/signup" element={<SignUp />} />
            <Route path="/roommates" element={<RoommateSearch />} />
            <Route path="/buildings" element={<BuildingSearch />} />
            <Route 
              path="/profile" 
              element={<UserProfile />} 
            />
            <Route 
              path="/profile/:id" 
              element={<ProfileView />} 
            />
            <Route path="/roommate-search" element={<RoommateSearch />} />
            <Route path="/building-search" element={<BuildingSearch />} />
            <Route path="/building/:id" element={<BuildingDetails />} />
          </Routes>
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
